The '''School of Psychology''' is a constituent body of the [[Sydney Faculty of Science|Faculty of Science]] at the [[University of Sydney]], [[Australia]]. It is the first established School of Psychology in Australia, and currently one of the largest and most prestigious.<ref>http://www.psych.usyd.edu.au/info/About_Psych.html</ref>
